  const [navIconClicked, setNavIconClicked] = useState("navbar-toggler-icon");
  const [isClicked, setIsClicked] = useState(false);

  const [fadeOutMenu, setFadeOutMenu] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });
  const [isMenuClicked, setIsMenuClicked] = useState(false);

  const [fadeOutEffect, setfadeOutEffect] = useState({
    "-webkit-animation-name": "",
    "animation-name": "",
    "animation-duration": ""
  });

  const [normalH3, clickH3] = useState("Projects");
  
  const [projectListclassName, setProjectListclassName] = useState("carousel slide carousel-fade");

  const [faviconclassName, setFaviconclassName] = useState("");

  function handleClick(){
    if (!isClicked) {
      setNavIconClicked("navbarClicked");
      clickH3("");
      setIsClicked(true);
      setProjectListclassName("hidden");
      setFaviconclassName("hidden");
    }else{
      setNavIconClicked("navbarClicked2");
      clickH3("Projects");
      setIsClicked(false);
      setProjectListclassName("carousel slide carousel-fade");
      setFaviconclassName("");
    }

    if (!isMenuClicked) {
      setFadeOutMenu({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setIsMenuClicked(true);
    }
    else{
      setFadeOutMenu({
        "-webkit-animation-name": "fadeOutRight",
        "animation-name": "fadeOutRight",
        "animation-duration": "0.5s"
      })
      setfadeOutEffect({
        "-webkit-animation-name": "fadeInRight",
        "animation-name": "fadeInRight",
        "animation-duration": "1s"
      })
      setIsMenuClicked(false);
    }
  };

    return (

      <>

      <section id="projects" classNameName="skills-section color-443829">
            <div classNameName="overlay2"></div>
            <h3 style={fadeOutEffect}>{normalH3}</h3>

<div style={fadeOutEffect} id="myCarousel" className={projectListclassName} data-ride="carousel" data-interval="10000" data-pause="hover">
        
        <ol className="carousel-indicators">
          <li data-target="#myCarousel" data-slide-to="0" className="active"></li>
          <li data-target="#myCarousel" data-slide-to="1"></li>
          <li data-target="#myCarousel" data-slide-to="2"></li>
          <li data-target="#myCarousel" data-slide-to="3"></li>
          <li data-target="#myCarousel" data-slide-to="4"></li>
          <li data-target="#myCarousel" data-slide-to="5"></li>
          <li data-target="#myCarousel" data-slide-to="6"></li>
          <li data-target="#myCarousel" data-slide-to="7"></li>
          <li data-target="#myCarousel" data-slide-to="8"></li>
          <li data-target="#myCarousel" data-slide-to="9"></li>
          <li data-target="#myCarousel" data-slide-to="10"></li>
          <li data-target="#myCarousel" data-slide-to="11"></li>
          <li data-target="#myCarousel" data-slide-to="12"></li>
          <li data-target="#myCarousel" data-slide-to="13"></li>
          <li data-target="#myCarousel" data-slide-to="14"></li>
        </ol>
        
        <div className="carousel-inner">

          <div className="carousel-item active">
          <Spacetourism className="slide-item first-slide" alt="First slide" />
          </div>
          <div className="carousel-item">
          <Drumkit className="slide-item second-slide" alt="Second slide" />
          </div>
          <div className="carousel-item"> 
          <Simonsgame className="slide-item third-slide" alt="Third slide" />
          </div>
          <div className="carousel-item">
          <Tindog className="slide-item fourth-slide" alt="Fourth slide" />
          </div>
          <div className="carousel-item">
          <Newslettersignup className="slide-item fifth-slide" alt="Fifth slide" />
          </div>
          <div className="carousel-item">
          <Dicegame className="slide-item sixth-slide" alt="Sixth slide" />
          </div>
          <div className="carousel-item">
          <Personalsite className="slide-item seventh-slide" alt="Seventh slide" />
          </div>
          <div className="carousel-item">
          <Blogwebsite className="slide-item eighth-slide" alt="Eighth slide" />
          </div>
          <div className="carousel-item">
          <Emojipedia className="slide-item ninth-slide" alt="Ninth slide" />
          </div>
          <div className="carousel-item">
          <Keeperapp className="slide-item tenth-slide" alt="Tenth slide" />
          </div>
          <div className="carousel-item">
          <Timeapp className="slide-item eleventh-slide" alt="Eleventh slide" />
          </div>
          <div className="carousel-item">
          <Todolistv1 className="slide-item twelveth-slide" alt="Twelveth slide" /> 
          </div>
          <div className="carousel-item">
          <Todolistv2 className="slide-item thirteenth-slide" alt="Thirteenth slide" />
          </div>
          <div className="carousel-item">
          <Spreadoperator className="slide-item fourteenth-slide" alt="Fourteeth slide" />
          </div>
          <div className="carousel-item">
          <Secretswebsite className="slide-item fifteenth-slide" alt="Fifteenth slide" />
          </div>

        </div>
        <a className="carousel-control-prev" href="#myCarousel" role="button" data-slide="prev">
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="sr-only">Previous</span>
        </a>
        <a className="carousel-control-next" href="#myCarousel" role="button" data-slide="next">
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="sr-only">Next</span>
        </a>
      </div>

      </section>

  <header>

  <img className={faviconclassName} src="logo/favicon.ico" />

  <div className="pos-f-t" id="my-navbar-collapse">
      <div className="collapse navbar-collapse" id="navbarToggleExternalContent">
        <div className="menu" style={fadeOutMenu}>
          <ul className="nav navbar-nav">
            <li>
              <a className="nav-link nav-links" href="/about">About</a>
            </li>
            <li>
              <a className="nav-link nav-links" href="/skills">Skills & Tools</a>
            </li>
            <li>
              <a className="nav-link nav-links" href="/projects">Projects</a>
            </li>
            <li>
              <a className="nav-link nav-links" href="/contact">Contact</a>
            </li>
            <li>
              <a className="nav-link nav-links" href="Jeffin_Jaison_Resume.pdf">
              <svg className="download-button" xmlns="http://www.w3.org/2000/svg" width="25" height="25" viewBox="0 0 24 24"><path d="M19 9h-4V3H9v6H5l7 7 7-7zM5 18v2h14v-2H5z"/></svg>
              Resume</a>
            </li>
          </ul>
        </div>
      </div>
      <nav className="navbar navbar-dark">
        <button className="navbar-toggler" 
        type="button" 
        data-toggle="collapse" 
        data-target="#navbarToggleExternalContent"
        aria-controls="navbarToggleExternalContent"
        aria-expanded="false"
        aria-label="Toggle navigation"
        onClick={handleClick}>
          <span className={navIconClicked}></span>
        </button>
      </nav>
    </div>
  </header>

</>

)};

export default Projects;
